import React from "react";
import "./index.css";
import pic from "./images/cricket.mp4";

const youtube = "GAMERZAM";

const facebook = "Muhamamd Zaeem";

const pubg = "fortnite";

function Check() {
  return <h1>fortnite</h1>;
}

function Timerr() {
  let h = new Date();
  h = h.getHours();
  let f = <h9>Date : {h}</h9>;
  return f;
}

function perfect() {
  return;
  <>
    <h1>Hi my name is zaeem</h1>
    <ol className="stal">
      <li>zaeem</li>
      <li>{youtube}</li>
      <li>{facebook}</li>
      <li>{pubg}</li>
      <li>{Check()}</li>
      <li>{Timerr()}</li>
    </ol>
    <div>
      <video loop autoPlay muted src={pic} />
    </div>
  </>;
}

export default youtube;

export { facebook, pubg, Check, Timerr, perfect };
